import React from 'react'

export default function Divs() {
    var browser_code_name = navigator.appCodeName;
    var Browser_Version = navigator.appVersion
    let product = navigator.product;
    var Browser_Language = navigator.language
    var platform = navigator.platform
    var User_agent_header = navigator.userAgent
  return (
    <>
        <div style={{display:'flex',marginTop:'7rem'}}>
            <div style={{marginInline:'0.4rem',width:'9rem',height:'6rem'}}  onClick={()=>{window.location.assign("https://www.youtube.com/")}}>
              <img id='[1,0]' width='140' height='80' style={{borderRadius:'0.5rem'}} src='data:image/png;base64,' alt='YouTube'/>
            </div>
            <div style={{marginInline:'0.4rem',width:'9rem',height:'6rem'}} onClick={()=>{window.location.assign("https://www.netflix.com")}}>
              <img id='[1,1]' width='140' height='80' src="data:image/png;base64," alt='' style={{borderRadius:'0.5rem'}}/>
            </div>
            <div style={{marginInline:'0.4rem',width:'9rem',height:'6rem'}} onClick={()=>{window.location.assign("https://open.spotify.com/")}}>
              <img id='[1,2]' width='140' height='80' src="data:image/png;base64," alt='' style={{borderRadius:'0.5rem'}}/>
            </div>
            <div style={{marginInline:'0.4rem',width:'9rem',height:'6rem'}} onClick={()=>{window.location.assign("https://www.primevideo.com/?ref_=dvm_pds_amz_in_as_s_g_176")}}>
              <img id='[1,3]' width='140' height='80' src="data:image/png;base64," alt='' style={{borderRadius:'0.5rem'}}/>
            </div>
            <div style={{marginInline:'0.4rem',width:'9rem',height:'6rem'}} onClick={()=>{window.location.assign("https://www.hbomax.com")}}>
              <img id='[1,4]' width='140' height='80' src="data:image/jpeg;base64," alt='' style={{borderRadius:'0.5rem'}}/>
            </div>
            <div style={{marginInline:'0.4rem',width:'9rem',height:'6rem'}} onClick={()=>{window.location.assign("https://www.hulu.com/welcome?orig_referrer=https%3A%2F%2Fwww.google.com%2F")}}>
              <img id='[1,5]' width='140' height='80' src="data:image/jpeg;base64," alt='' style={{borderRadius:'0.5rem'}}/>
            </div>
            <div style={{marginInline:'0.4rem',width:'9rem',height:'6rem'}} onClick={()=>{window.location.assign("https://play.google.com/store/apps")}}>
              <img id='[1,6]' width='140' height='80' src="data:image/png;base64," alt='' style={{borderRadius:'0.5rem'}}/>
            </div>
        </div>

        <div id='inputs' style={{position:'fixed',right:'0px',width:'30%',height:'100vh',backgroundColor:'#333',top:'0px',padding:'1rem',display:'none'}}>
            <h1 style={{textAlign:'center',marginBottom:'4rem'}}>Press esc to close</h1>
            <h4>Browser Code Name : {browser_code_name}</h4>
            <h4>Browser Version : {Browser_Version}</h4>
            <h4>Browser Engine : {product}</h4>
            <h4>Browser Language: {Browser_Language}</h4>
            <h4>PlatForm : {platform}</h4>
            <h4>User Agent Header : {User_agent_header}</h4>
        </div>

        <div id='setting' style={{position:'fixed',right:'0px',width:'30%',height:'100vh',backgroundColor:'#333',top:'0px',padding:'1rem',display:'none'}}>
          <h2 style={{textAlign:'right'}}>Press esc to close</h2>
          <h1>Navigations</h1>

          <div style={{display:'flex',borderTop:'2px solid white'}}>
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 14" strokeWidth="1.5" stroke="currentColor" width='50' height='50'>
              <path strokeLinecap="round" strokeLinejoin="round" d="M4.5 10.5L12 3m0 0l7.5 7.5M12 3v18" />
            </svg>
            <h2 style={{marginLeft:'3rem'}}>MOVE UP</h2>
          </div>

          <div style={{display:'flex'}}>
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 -2 24 24" strokeWidth="1.5" stroke="currentColor" width='50' height='50'>
              <path strokeLinecap="round" strokeLinejoin="round" d="M19.5 13.5L12 21m0 0l-7.5-7.5M12 21V3" />
            </svg>
            <h2 style={{marginLeft:'3rem'}}>MOVE DOWN</h2>
          </div>

          <div style={{display:'flex'}}>
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 17" strokeWidth="1.5" stroke="currentColor" width='50' height='50'>
              <path strokeLinecap="round" strokeLinejoin="round" d="M10.5 19.5L3 12m0 0l7.5-7.5M3 12h18" />
            </svg>
            <h2 style={{marginLeft:'3rem'}}>MOVE LEFT</h2>
          </div>

          <div style={{display:'flex'}}>
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" width='50' height='50' >
              <path strokeLinecap="round" strokeLinejoin="round" d="M13.5 4.5L21 12m0 0l-7.5 7.5M21 12H3" />
            </svg>
            <h2 style={{marginLeft:'3rem'}}>MOVE RIGHT</h2>
          </div>

          <div style={{display:'flex'}}>
            <h2 style={{border:'1px solid white',padding:'10px'}}>alt</h2>
            <h2 style={{marginLeft:'3rem',marginTop:'2rem'}}>TO SELECT </h2>
          </div>

        </div>
    </>
  )
}
